import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { QueryClient, QueryClientProvider } from 'react-query';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Components
import Header from './components/layout/Header';
import Footer from './components/layout/Footer';
import PrivateRoute from './components/auth/PrivateRoute';

// Pages
import Home from './pages/Home';
import Login from './pages/auth/Login';
import Register from './pages/auth/Register';
import BusquedaAvanzada from './pages/BusquedaAvanzada';
import ListaTrabajos from './pages/ListaTrabajos';
import DetalleTrabajo from './pages/DetalleTrabajo';
import PerfilUsuario from './pages/PerfilUsuario';
import Dashboard from './pages/dashboard/Dashboard';
import SubirTrabajo from './pages/dashboard/SubirTrabajo';
import GestionTrabajos from './pages/dashboard/GestionTrabajos';
import ConfiguracionCarreras from './pages/dashboard/ConfiguracionCarreras';
import Estadisticas from './pages/dashboard/Estadisticas';
import NotFound from './pages/NotFound';

// Context
import { AuthProvider } from './context/AuthContext';
import { useAuth } from './context/AuthContext';

// Create a client
const queryClient = new QueryClient({
  defaultOptions: {
    queries: {
      refetchOnWindowFocus: false,
      retry: 1,
      staleTime: 5 * 60 * 1000, // 5 minutes
    },
  },
});

function AppRoutes() {
  const { user, isLoading } = useAuth();

  if (isLoading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gray-50">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-800"></div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col">
      <Header />

      <main className="flex-1">
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={user ? <Navigate to="/dashboard" /> : <Login />} />
          <Route path="/register" element={user ? <Navigate to="/dashboard" /> : <Register />} />

          {/* Search and Browse Routes */}
          <Route path="/busqueda" element={<BusquedaAvanzada />} />
          <Route path="/trabajos" element={<ListaTrabajos />} />
          <Route path="/trabajo/:id" element={<DetalleTrabajo />} />

          {/* Protected Routes */}
          <Route 
            path="/perfil" 
            element={
              <PrivateRoute>
                <PerfilUsuario />
              </PrivateRoute>
            } 
          />

          {/* Dashboard Routes */}
          <Route 
            path="/dashboard" 
            element={
              <PrivateRoute>
                <Dashboard />
              </PrivateRoute>
            } 
          />
          <Route 
            path="/dashboard/subir" 
            element={
              <PrivateRoute>
                <SubirTrabajo />
              </PrivateRoute>
            } 
          />
          <Route 
            path="/dashboard/gestion" 
            element={
              <PrivateRoute requiredRoles={['encargado_especial_grado', 'superuser_especial_grado', 'encargado_pasantias', 'superuser_pasantias', 'administrador']}>
                <GestionTrabajos />
              </PrivateRoute>
            } 
          />
          <Route 
            path="/dashboard/carreras" 
            element={
              <PrivateRoute requiredRoles={['administrador']}>
                <ConfiguracionCarreras />
              </PrivateRoute>
            } 
          />
          <Route 
            path="/dashboard/estadisticas" 
            element={
              <PrivateRoute requiredRoles={['administrador', 'superuser_especial_grado', 'superuser_pasantias']}>
                <Estadisticas />
              </PrivateRoute>
            } 
          />

          {/* 404 Route */}
          <Route path="*" element={<NotFound />} />
        </Routes>
      </main>

      <Footer />
    </div>
  );
}

function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <AuthProvider>
        <Router>
          <AppRoutes />
          <ToastContainer
            position="top-right"
            autoClose={5000}
            hideProgressBar={false}
            newestOnTop={false}
            closeOnClick
            rtl={false}
            pauseOnFocusLoss
            draggable
            pauseOnHover
            theme="light"
          />
        </Router>
      </AuthProvider>
    </QueryClientProvider>
  );
}

export default App;
